document.addEventListener("DOMContentLoaded",function(){Array.prototype.forEach.call(document.querySelectorAll("[data-uri]"),function(t){t.onclick=function(){"_window"==this.dataset.target?window.open(this.dataset.uri,"targetWindow","toolbar=no,location=no,status=no,menubar=no,scrollbars=yes,resizable=yes,width=500px,height=500px"):"_blank"==this.dataset.target?window.open(this.dataset.uri,"_blank"):window.location.href=this.dataset.uri}})});
